# -*- coding: utf-8 -*-import datetimeimport os.path,reimport osimport randomimport string,jsonimport requestsimport pandas as pdimport timefrom spider.encrypt import Encryptfrom utils.img_to_base64 import img_to_base64from utils.browser import Browserfrom configs.config import headres,proxies,logclass Ali1688(Browser):    """    用于阿里1688的以图搜索，爬取及保存结果。    不需要账号登录的版本    """    def __init__(self,img_path):        super().__init__()        self.upload_url = "https://stream-upload.taobao.com/api/upload.api?appkey=1688search&folderId=0&_input_charset=utf-8&useGtrSessionFilter=false"  # 上传图片        self.imageSearch_service_url = "https://open-s.1688.com/openservice/imageSearchOfferResultViewService"        self.img_path = img_path        self.img_name = self.img_path.split('\\')[-1]        self.search_page_size = 40        self.headers = headres    def setSearchPageSize(self, pageSize):        self.search_page_size = pageSize    def search_img(self):        """        获取搜索后的结果（json）        :return:        """        # 图片转为base64        img_base64 = img_to_base64(self.img_path)        # img_base64 = ''        # print(img_base64)        data = '{"imageBase64":"%s","appName":"searchImageUpload","appKey":"pvvljh1grxcmaay2vgpe9nb68gg9ueg2"}' % img_base64        imageId,requestId,sessionId = Encrypt(data).upload_img()        cookie = open('./data/cookie.txt', 'r').read()        log.info('搜索图片获取到所需的三个参数')        self.headers['cookie'] = cookie        search_img_url = f'https://search.1688.com/service/imageSearchOfferResultViewService?tab=imageSearch&imageId={imageId}&imageIdList={imageId}&sortField=sold_quantity&sortType=desc&pailitaoCategoryId=88888888&beginPage=1&pageSize=40&requestId={requestId}&pageName=image&sessionId={sessionId}'        search_img_res = requests.get(search_img_url,headers=self.headers,proxies=proxies).text        log.info('获取搜索图片的结果完成')        return search_img_res    def check_goods(self, html):        """        todo 这里需要匹配,处理数据，转化为df        :param html:        :return:        """        info_json = json.loads(html)        offerList = info_json['data']['data']['offerList']        offerDict = {}        titleList = []        detailUrlList = []        saleCountList = []        priceList = []        imgNameList = []        gmv30dayList = []        nowTimeList = []        nowTime = time.strftime("%Y-%m-%d %H:%M:%S", time.localtime())        for offer in offerList:            title = offer['information']['subject']            # print(title)            detailUrl = offer['information']['detailUrl']            saleCount = offer['tradeQuantity']['saleQuantity']            try:                price = offer['tradePrice']['offerPrice']['priceInfo']['price']            except:                price = '价格授权可见'                log.error('价格授权可见')            gmv30day = offer['tradeQuantity']['gmv30dRt']            titleList.append(title)            detailUrlList.append(detailUrl)            saleCountList.append(saleCount)            priceList.append(price)            imgNameList.append(self.img_name)            gmv30dayList.append(gmv30day)            nowTimeList.append(nowTime)        offerDict['imgName'] = imgNameList        offerDict['title'] = titleList        offerDict['detailUrl'] = detailUrlList        offerDict['saleCount'] = saleCountList        offerDict['price'] = priceList        offerDict['gmv30day'] = gmv30dayList        offerDict['time'] = nowTimeList        # resultJson = json.dumps(resultList)        df = pd.DataFrame(offerDict)        log.info('{} 爬取的结果，显示前三行'.format(self.img_name))        # log.info(df.head(3))        print(df.head(3))        return df    def save_data(self,df):        """        结果保存，保存为csv格式        :param df:        :return:        """        today = datetime.date.today()        filename = f'./data/result/{today}_result.csv'        if not os.path.exists(filename):            df.to_csv(filename, index=False, mode='a+', encoding='utf-8-sig')        else:            df.to_csv(filename, index=False, mode='a+', encoding='utf-8-sig', header=False)        log.info('************* {} 的数据爬取及存储完成！*************'.format(self.img_name))        time.sleep(random.uniform(40, 80))    def run(self):        html = self.search_img()        df = self.check_goods(html)        self.save_data(df)        return True# Ali1688('../data/img/1.jpg').run()